import React, { Fragment } from "react";

const AddNewProduct = () => {
  return (
    <Fragment>
      <button
        className="btn-sm btn-primary form-control"
        data-toggle="modal"
        data-target="product-modal"
      >
        Add New Product
      </button>
    </Fragment>
  );
};

export default AddNewProduct;
